import React from 'react';

function ListaVehiculos(props) {

  

 
    return (
      <React.Fragment>

<h1>Vehículos</h1>
{props.datos.length !== 0
          ? 
          props.datos.map((v, i, a) => {
            {}
            return (
              <p
                id={v.value.url}
                key={i}
                onClick={() => {
                  props.funcionVehicle(v.value.url);
                }}
              >
                {v.value.name}
              </p>
            );
          })
          : ( <p className='alert'>No se han encontrado los Actores de esta película</p>)}
        
        
      </React.Fragment>
    );
  }
  
  export default ListaVehiculos;
